import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Button,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Box,
  CircularProgress,
} from '@mui/material';
import { ethers } from 'ethers';
import MysteryBoxLaunchpad from '../contracts/MysteryBoxLaunchpad.json';

function MysteryBox() {
  const [boxes, setBoxes] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [loading, setLoading] = useState(false);
  const [formData, setFormData] = useState({
    floorPrice: '',
    duration: '',
    totalSupply: '',
    metadataURI: '',
  });

  useEffect(() => {
    fetchMysteryBoxes();
  }, []);

  const fetchMysteryBoxes = async () => {
    try {
      const provider = new ethers.BrowserProvider(window.ethereum);
      const contract = new ethers.Contract(
        process.env.REACT_APP_MYSTERY_BOX_ADDRESS,
        MysteryBoxLaunchpad.abi,
        provider
      );

      // Fetch active mystery boxes
      const boxCount = await contract._boxIds.current();
      const boxPromises = [];

      for (let i = 1; i <= boxCount; i++) {
        boxPromises.push(contract.mysteryBoxes(i));
      }

      const boxData = await Promise.all(boxPromises);
      setBoxes(boxData.filter(box => box.isActive));
    } catch (error) {
      console.error('Error fetching mystery boxes:', error);
    }
  };

  const handleCreateBox = async () => {
    try {
      setLoading(true);
      const provider = new ethers.BrowserProvider(window.ethereum);
      const signer = await provider.getSigner();
      const contract = new ethers.Contract(
        process.env.REACT_APP_MYSTERY_BOX_ADDRESS,
        MysteryBoxLaunchpad.abi,
        signer
      );

      const tx = await contract.createMysteryBox(
        ethers.parseEther(formData.floorPrice),
        ethers.parseEther(formData.duration),
        formData.totalSupply,
        formData.metadataURI
      );

      await tx.wait();
      setOpenDialog(false);
      fetchMysteryBoxes();
    } catch (error) {
      console.error('Error creating mystery box:', error);
    } finally {
      setLoading(false);
    }
  };

  const handlePlaceBid = async (boxId, floorPrice) => {
    try {
      setLoading(true);
      const provider = new ethers.BrowserProvider(window.ethereum);
      const signer = await provider.getSigner();
      const contract = new ethers.Contract(
        process.env.REACT_APP_MYSTERY_BOX_ADDRESS,
        MysteryBoxLaunchpad.abi,
        signer
      );

      const tx = await contract.placeBid(boxId, {
        value: ethers.parseEther(floorPrice),
      });

      await tx.wait();
      fetchMysteryBoxes();
    } catch (error) {
      console.error('Error placing bid:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="lg">
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 4 }}>
        <Typography variant="h4" component="h1">
          Mystery Box Launchpad
        </Typography>
        <Button
          variant="contained"
          color="primary"
          onClick={() => setOpenDialog(true)}
        >
          Create Mystery Box
        </Button>
      </Box>

      <Grid container spacing={3}>
        {boxes.map((box) => (
          <Grid item xs={12} md={6} lg={4} key={box.boxId.toString()}>
            <Card>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  Mystery Box #{box.boxId.toString()}
                </Typography>
                <Typography color="text.secondary">
                  Floor Price: {ethers.formatEther(box.floorPrice)} MON
                </Typography>
                <Typography color="text.secondary">
                  Duration: {ethers.formatEther(box.duration)} days
                </Typography>
                <Typography color="text.secondary">
                  Supply: {box.currentSupply.toString()} / {box.totalSupply.toString()}
                </Typography>
              </CardContent>
              <Box sx={{ p: 2 }}>
                <Button
                  variant="contained"
                  color="primary"
                  fullWidth
                  onClick={() => handlePlaceBid(box.boxId, box.floorPrice)}
                  disabled={loading}
                >
                  Place Bid
                </Button>
              </Box>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Dialog open={openDialog} onClose={() => setOpenDialog(false)}>
        <DialogTitle>Create Mystery Box</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Floor Price (MON)"
            type="number"
            fullWidth
            value={formData.floorPrice}
            onChange={(e) => setFormData({ ...formData, floorPrice: e.target.value })}
          />
          <TextField
            margin="dense"
            label="Duration (days)"
            type="number"
            fullWidth
            value={formData.duration}
            onChange={(e) => setFormData({ ...formData, duration: e.target.value })}
          />
          <TextField
            margin="dense"
            label="Total Supply"
            type="number"
            fullWidth
            value={formData.totalSupply}
            onChange={(e) => setFormData({ ...formData, totalSupply: e.target.value })}
          />
          <TextField
            margin="dense"
            label="Metadata URI"
            type="text"
            fullWidth
            value={formData.metadataURI}
            onChange={(e) => setFormData({ ...formData, metadataURI: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpenDialog(false)}>Cancel</Button>
          <Button
            onClick={handleCreateBox}
            variant="contained"
            disabled={loading}
          >
            {loading ? <CircularProgress size={24} /> : 'Create'}
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
}

export default MysteryBox;
